import React from 'react';
import Article from './Article.js';
import './Head.css';

function Head() {
  return (
    <div className='Head'>

      <Article />

      <div id='about'>
        <b>About Bernard Mendez</b>
        <p>Bernard is a journalist based out of Los Angeles. He is currently the News editor at the Daily Bruin, the independent student newspaper at UCLA, and a third-year Applied Mathematics student. He is also a contributor for CalMatters as part of its College Journalism Network. You can contact Bernard at contact@bernardmendez.com.</p>
      </div>

    </div>
  );
}

export default Head;
